
let obj = {
    array:[1,2,3,4,5,6,8,9]
}

with(obj){
    let str = ''
    str += `<!DOCTYPE html>
    <html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <meta http-equiv="X-UA-Compatible" content="ie=edge">
        <title>Document</title>
    </head>
    <body>`
    array.forEach((element) => {
        str += `<li >${element}</li>`
    })
    str += `</body></html>`
}

console.log(str)
